import React from 'react';
import '../common/PageHeader.css';

const TasksHeader = (props) => {
    return (
        // <div className="page-header-container">

        //     <h1>{props.title}</h1>
        // </div>

        <nav className="navbar navbar-expand-lg navbar-light">
            <div className="mr-auto">
                <div className="navbar-brand" href="/">Task List</div>
            </div>

            <form class="form-inline my-2 my-lg-0">
                <a class="btn btn-outline-success my-2 my-sm-0" href="/tasks" role="button">Tasks</a>
                <button class="btn btn-outline-success my-2 my-sm-0" type="submit">New Task</button>
            </form>
        </nav>
    );
};

export default TasksHeader;
